import React from 'react'
import {useNavigate} from 'react-router-dom'
function Home() {
  let navigate=useNavigate()
  let gototech=()=>{
    navigate("/technologies")
  }
  return (
  <div>
 <p className='fs-3 text-center'>Home</p>
    <button onClick={gototech}> to technologies</button>
  </div>
   
  )
}

export default Home
